import React from "react";
import Signin from "./components/Signin";
import Signup from "./components/Signup";
import {
  BrowserRouter,
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <div className="content">
        <BrowserRouter>
          <Routes>
            <Route path="/">
              <Signin />
            </Route>
            <Route path="/sign-up">
              <Signup />
            </Route>
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
